static void ClearError() {
	ErrorRender = 0;
}

static void ReportError(const char *fmt, ...) {
	va_list args;
	va_start(args, fmt);
	vsnprintf(ErrorBuffer, sizeof(ErrorBuffer), fmt, args);
	va_end(args);
	ErrorRender = 1;
}

GLuint GL_CompileShader(GLenum type, GLsizei count, const GLchar **string, bool *ok) {
	if (!*ok) return 0;

	GLuint shader = GL.CreateShader(type);
	GL.ShaderSource(shader, count, string, NULL);
	GL.CompileShader(shader);

	GLint success;
	GL.GetShaderiv(shader, GL_COMPILE_STATUS, &success);
	if (!success) {
		GLchar message[512];
		GL.GetShaderInfoLog(shader, 512, NULL, message);
		char *str_type = (type == GL_VERTEX_SHADER) ? "Vertex" : "Fragment";
		ReportError("%s Shader compilation failed: %s\n", str_type, message);
		*ok = false;
		return 0;
	}
	return shader;
}

GLuint GL_CompileProgram(GLuint vertex, GLuint fragment, bool *ok) {
	if (!*ok) return 0;

	GLuint id = GL.CreateProgram();
	GL.AttachShader(id, vertex);
	GL.AttachShader(id, fragment);
	GL.LinkProgram(id);

	GLint success;
	GL.GetProgramiv(id, GL_LINK_STATUS, &success);
	if (!success) {
		GLchar message[512];
		GL.GetProgramInfoLog(id, 512, NULL, message);
		ReportError("Linking Shader faliled: %s\n", message);
		GL.DeleteProgram(id);
		*ok = false;
		return -1;
	}

	return id;
}

