static void GL_GetUniformLocations(GLuint program, int *out) {
	static const char *UniformNames[] = { "Time", "DeltaTime", "Resolution", "Mouse" };
	for (int i = 0; i < Uniform_EnumCount; ++i) {
		out[i] = GL.GetUniformLocation(program, UniformNames[i]);
	}
}

static void GL_GetFramebufferSize(int *width, int *height) {
	RECT rect;
	if (GetClientRect(WindowHandle, &rect)) {
		*width  = rect.right - rect.left;
		*height = rect.bottom - rect.top;
	} else {
		*width  = 0;
		*height = 0;
	}
}

typedef struct String {
	size_t Length;
	char   Data[1];
} String;

static String *PL_ReadShaderFileIfModified(wchar_t *filepath, uint64_t *last_modified) {
	HANDLE handle = CreateFileW(filepath, GENERIC_READ, FILE_SHARE_READ, 0, OPEN_EXISTING, FILE_ATTRIBUTE_NORMAL, 0);
	if (handle == INVALID_HANDLE_VALUE) {
		ReportError("Failed to load file: %S", filepath);
		return NULL;
	}

	static char Line[] = "#line 0 1\n";
	int len = strlen(Line);

	String *content = NULL;

	FILETIME write_time;
	if (GetFileTime(handle, NULL, NULL, &write_time)) {
		ULARGE_INTEGER r;
		r.HighPart = write_time.dwHighDateTime;
		r.LowPart  = write_time.dwLowDateTime;

		if (r.QuadPart > *last_modified) {
			LARGE_INTEGER size;
			GetFileSizeEx(handle, &size);

			content = HeapAlloc(GetProcessHeap(), 0, len + size.QuadPart + sizeof(String));
			if (content) {
				content->Length = len + size.QuadPart;
				memcpy(content->Data, Line, len);
				if (ReadFile(handle, content->Data + len, size.QuadPart, NULL, NULL)) {
					content->Data[content->Length] = 0;
					*last_modified = r.QuadPart;
				} else {
					ReportError("Failed to read file: %S", filepath);
					HeapFree(GetProcessHeap(), 0, content);
					content = 0;
				}
			} else {
				ReportError("Failed to allocate memory to load file: %S", filepath);
			}
		}
	}

	CloseHandle(handle);

	return content;
}

static GLuint GL_CreateTexture(int width, int height, int channels, void *pixels) {
	GLenum fmt;

	switch (channels) {
		case 1: fmt = GL_RED;
		case 2: fmt = GL_RG;
		case 3: fmt = GL_RGB;
		case 4: fmt = GL_RGBA;
	}

	GLuint texture;
	GL.GenTextures(1, &texture);
	GL.BindTexture(GL_TEXTURE_2D, texture);
	GL.TexParameteri(GL_TEXTURE_2D, GL_TEXTURE_WRAP_S, GL_REPEAT);
	GL.TexParameteri(GL_TEXTURE_2D, GL_TEXTURE_WRAP_T, GL_REPEAT);
	GL.TexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MIN_FILTER, GL_LINEAR_MIPMAP_LINEAR);
	GL.TexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MAG_FILTER, GL_LINEAR_MIPMAP_LINEAR);
	GL.TexImage2D(GL_TEXTURE_2D, 0, GL_RGBA, width, height, 0, fmt, GL_UNSIGNED_BYTE, pixels);
	GL.GenerateMipmap(GL_TEXTURE_2D);
	return texture;
}

typedef struct GlyphRange {
	float Width, Height;
	float OffsetX, OffsetY;
	float MinX, MinY;
	float MaxX, MaxY;
} GlyphRange;

typedef struct MonospacedFontInfo {
	uint32_t    First;
	uint32_t    Last;
	float       Advance;
	uint32_t    Size;
	GlyphRange  Range[0];
} MonospacedFontInfo;

typedef struct MonospacedFont {
	GLuint              Texture;
	MonospacedFontInfo *Info;
} MonospacedFont;

MonospacedFont PL_GetMonospacedFont() {
	MonospacedFont font;
	memset(&font, 0, sizeof(font));

	font.Info = (MonospacedFontInfo *)MonoSpacedFontData;

	const uint8_t *ptr = MonoSpacedFontData + sizeof(MonospacedFontInfo);
	ptr += font.Info->Size;

	int *next = (int *)ptr;

	int width    = next[0];
	int height   = next[1];
	int channels = next[2];
	void *pixels = (next + 3);
	font.Texture = GL_CreateTexture(width, height, channels, pixels);

	return font;
}

